{'Location': '#26/4 & 5, Dr.Rajkumar Road,Opp. Govt. Soap Factory,, Rajajinagar, Bangalore, India, 560055', 'overall_rating': '7.0', 'Name': 'Parijatha Gateway Hotel', 'reviews': [{'Review_Rating': '9.6', 'Review_Heading': 'Exceptional‚Äù', 'Review_Body': 'Value for money hotel at the heart of Bangalore next to a metro station. Only vegetarian food but preparation is good.'}, {'Review_Rating': '10.0', 'Review_Heading': 'Exceptional‚Äù', 'Review_Body': 'gud location close to YPR rail station and rooms were clean and breakfast was adequate. '}, {'Review_Rating': '10.0', 'Review_Heading': 'So good I went back a week later and stayed there AGAIN‚Äù', 'Review_Body': 'This is a budget priced hotel that tries very  hard.  Clean and pleasant, with friendly staff.  The wifi and wired internet were both fast. The laundry services were good.  Sure, its not the Conrad Hilton Bangalore, but once you close your eyes at night, at 1/3 the price of the Hilton, I sure sleep better!  (Yes I also stayed at the Conrad on this trip while on the expense account).  My rear-facing room, away from the street, was surprisingly quiet (despite the subway being right outside the other side of the hotel, and traffic roaring past).  It was a short 5 minute walk to the wonderful, modern Orion shopping mall, and a short (VERY MODERN) subway trip to all the wonders of Bangalore.  I went back a week later for another 4 days, and when I return, I will stay there again.  A good deal.'}, {'Review_Rating': '8.0', 'Review_Heading': 'Very good‚Äù', 'Review_Body': 'My stay was very comfortable. Staff was very co-operative. Breakfast was good. Rooms were neat and clean. Nearby Metro Station. Easy Approachable. '}, {'Review_Rating': '7.6', 'Review_Heading': 'Grand location, ok rooms and fine hotel‚Äù', 'Review_Body': 'Suitable for solo traveler, food is pure vegetarian, metro station of sandal soap factory is centimeters away from hotel... malls, hotels and pubs very near to location....'}, {'Review_Rating': '9.6', 'Review_Heading': 'Exceptional‚Äù', 'Review_Body': 'Good Hotel. Good services. I was hesitate to book the hotel because of all previous negative comments. However, I have no other choices. It turns out to be a very good hotel for its price. Would recommend to others.

